import React from 'react';
import Header from '../components/Header';

const TermsConditions = () => {
    return (
        <div>
            <Header />
            <main>
                <h1>Terms of Conditions</h1>
                <p>Your terms and conditions content goes here.</p>
            </main>
        </div>
    );
};

export default TermsConditions;
